 (395000,'Address - Address is effective as of <span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" fieldtype=\"DATE\" value=\"{0}\" style=\"width:110px\"/></span>','Address - Address is effective as of [AS OF DATE]','(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') BETWEEN CASE WHEN ADDRESS_ACTIVATION_STATUS = \'temporary\' THEN ADDRESS_TEMPORARY_START_DATE WHEN ADDRESS_ACTIVATION_STATUS = \'seasonal\' AND IS_IN_SEASON(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\'), ADDRESS_SEASONAL_START_DATE, ADDRESS_SEASONAL_END_DATE) = 1 THEN STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') WHEN ADDRESS_ACTIVATION_STATUS = \'seasonal\' THEN ADDDATE(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\'), 1) WHEN ADDRESS_ACTIVATION_STATUS = \'permanent\' AND ADDRESS_EFFECTIVE_DATE IS NOT NULL THEN ADDRESS_EFFECTIVE_DATE ELSE STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') END AND CASE WHEN ADDRESS_ACTIVATION_STATUS = \'temporary\' THEN ADDRESS_TEMPORARY_END_DATE ELSE STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') END)'),
 (396000,'Email Address - Email Address is effective as of <span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" fieldtype=\"DATE\" value=\"{0}\" style=\"width:110px\"/></span>','Email Address - Email Address is effective as of [AS OF DATE]','(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') BETWEEN CASE WHEN EMAIL_ACTIVATION_STATUS = \'temporary\' THEN EMAIL_TEMPORARY_START_DATE WHEN EMAIL_ACTIVATION_STATUS = \'seasonal\' AND IS_IN_SEASON(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\'), EMAIL_SEASONAL_START_DATE, EMAIL_SEASONAL_END_DATE) = 1 THEN STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') WHEN EMAIL_ACTIVATION_STATUS = \'seasonal\' THEN ADDDATE(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\'), 1) WHEN EMAIL_ACTIVATION_STATUS = \'permanent\' AND EMAIL_EFFECTIVE_DATE IS NOT NULL THEN EMAIL_EFFECTIVE_DATE ELSE STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') END AND CASE WHEN EMAIL_ACTIVATION_STATUS = \'temporary\' THEN EMAIL_TEMPORARY_END_DATE ELSE STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') END)'),
 (397000,'Phone Number - Phone Number is effective as of <span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0].criteria\" fieldtype=\"DATE\" value=\"{0}\" style=\"width:110px\"/></span>','Phone Number - Phone Number is effective as of [AS OF DATE]','(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') BETWEEN CASE WHEN PHONE_ACTIVATION_STATUS = \'temporary\' THEN PHONE_TEMPORARY_START_DATE WHEN PHONE_ACTIVATION_STATUS = \'seasonal\' AND IS_IN_SEASON(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\'), PHONE_SEASONAL_START_DATE, PHONE_SEASONAL_END_DATE) = 1 THEN STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') WHEN PHONE_ACTIVATION_STATUS = \'seasonal\' THEN ADDDATE(STR_TO_DATE(\'{0}\', \'%m/%d/%Y\'), 1) WHEN PHONE_ACTIVATION_STATUS = \'permanent\' AND PHONE_EFFECTIVE_DATE IS NOT NULL THEN PHONE_EFFECTIVE_DATE ELSE STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') END AND CASE WHEN PHONE_ACTIVATION_STATUS = \'temporary\' THEN PHONE_TEMPORARY_END_DATE ELSE STR_TO_DATE(\'{0}\', \'%m/%d/%Y\') END)'),
